import axios from "axios";
import React from "react";
import User from "./User";
import { Link } from "react-router-dom"

const Users = () => {
  const [users, setUsers] = React.useState("");

  React.useEffect(() => {
    axios.get("/api/users").then((users) => setUsers(users.data));
  }, []);
  console.log(users);
  return (
    <>
      <div class="w-full bg-white-800">
        <section class="max-w-6xl mx-auto px-4 sm:px-6 lg:px-4 py-12">
          <div class="text-center pb-12">
            <h2 class="text-base font-bold text-indigo-600">
              Bienvenido a la comunidad de peliculas m√°s grande
            </h2>
            <h1 class="font-bold text-3xl md:text-4xl lg:text-5xl font-heading text-white">
              Estos son los usuarios disponibles
            </h1>
          </div>
          <div
            class="shadow-md rounded-md overflow-hidden text-center"
            style={{
              width: 300,
            }}
          >
            <div ></div>
          </div>
          {users.map((us, i) => {
            return <User key={i} user={us}/>;
          })}
        </section>
      </div>
    </>
  );
};

export default Users;
